CREATE DEFINER=`root`@`localhost` FUNCTION `cek_pembelian_pelanggan` (`Nama` VARCHAR(32)) RETURNS VARCHAR(100) CHARSET utf8mb4 COLLATE utf8mb4_general_ci  BEGIN
	DECLARE jumlah INT;
           SELECT COUNT(orderan.id_orderan) INTO jumlah FROM pelanggan INNER JOIN orderan USING (id_pelanggan)	
              WHERE nama_pelanggan=Nama;
           IF (jumlah > 0) THEN
              RETURN CONCAT("Anda sudah bertransaksi sebanyak ",
              jumlah, " kali");
           ELSE
              RETURN "Anda belum pernah melakukan transaksi";
           END IF;


    END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `cek_total_pembayaran_pelanggan` (`nama` VARCHAR(32)) RETURNS VARCHAR(64) CHARSET utf8mb4 COLLATE utf8mb4_general_ci  BEGIN
    DECLARE total_pembayaran INT(9);
    SELECT SUM((detail_orderan.jumlah_orderan * menu.harga) + detail_orderan.ongkir) INTO total_pembayaran
    FROM pelanggan 
    INNER JOIN orderan USING (id_pelanggan) 
    INNER JOIN detail_orderan USING (id_orderan)
    INNER JOIN menu USING(id_menu)
    inner join bukti_pembayaran using(id_detail)
    WHERE pelanggan.nama_pelanggan = nama;
    RETURN total_pembayaran;
END$$

